import React, { Component } from 'react';
import { Widget } from 'react-chat-widget';
 
import 'react-chat-widget/lib/styles.css';
 
class ChatXX extends Component {
  render() {
    return (
      <div className="ChatXX">
        <Widget />
      </div>
    );
  }
}
 
export default ChatXX;
